import React, { Component } from 'react';

import Canvas from './Canvas';
import SpeechRecognition, { useSpeechRecognition } from 'react-speech-recognition';

export default function CanvasHook(props) {
    return <Canvas startListening={(config) => SpeechRecognition.startListening(config)} speechRecognition={(config) => useSpeechRecognition(config)} {...props} />;
}
